import React, { useEffect, useState } from 'react'
import axios from 'axios'

const FetchApi = () => {
  const [users, setUsers] = useState([])


  const getUsers = async () => {
    const response =await axios.get("https://jsonplaceholder.typicode.com/users")
    //    console.log(response)
    const data = response.data
    setUsers(data)

  }

  useEffect(() => {
    getUsers()
  }, [])
  
  return (
    <>
      {/* <button onClick={getUsers} style={{ background: "green", marginTop: "10px", marginLeft: "10px", fontSize: "25px", padding: "2px 4px", }}>Get Data</button> */}


      <div style={{ padding: "32px", margin: "10px 10px", background: "grey" }}>

        <ul>
          {users.map((e) => {
            return <li>{e.username}--- <a href=''>Explore</a></li>
          })
          }
        </ul>

      </div>
    </>
  )
}

export default FetchApi
